MY/ Artefact a perfect marriage of art and science and where luxury and sustainability are brought together in harmony. Artefact is not solely a new build but a stepping stone towards innovation. Alongside her aesthetically pleasing and unique design, minimising its carbon footprint was a fundamental objective that the owner strived to achieve and to exhibit how a luxury man-made object can blend together to flatter nature - ⚓
